import React from "react";

class TableRow extends React.Component {
  render() {
    return (
      <tr key={this.props.key}>
        <td data-id={this.props.key}>{this.props.key}</td>
        <td>{this.props.lastName}</td>
        <td>{this.props.jobTitle}</td>
      </tr>
    );
  }
}

export default TableRow;
